DROP DATABASE IF EXISTS sport;

CREATE DATABASE sport;

\connect sport

CREATE TABLE collections (
    id integer,
    name text
);

CREATE TABLE measurements (
    "timestamp" timestamp without time zone,
    profile integer,
    longitude numeric,
    latitude numeric,
    height numeric(6,2),
    distance numeric,
    duration integer,
    speed numeric(6,2)
);

CREATE TABLE profiles (
    id integer,
    type text,
    name text,
    collection integer
);





